import React from 'react';
import './Logo.css';

class Logo extends React.Component {

    render() {

        return (

            <section className="logo-area">
                <h2>iNavig8</h2>
                <img src="./img/iNavig8-logo.png" alt="iNavig8 Logo" title="iNavig8 Logo" />
            </section>

        );

    }

}

export default Logo;
